export function getLectureDetailById(id) {
  return axios
    .get(`localhost:8080/lectures/getalllectures/${id}`)
    .then((response) => {
      console.log("데이터", response.data);
    })
    .catch((error) => {
      console.log("아이디 찾는 중 오류발생", error);
    });
}
